CREATE DEFINER=`root`@`localhost` PROCEDURE `spFindCallsInRangeLatLong`(IN originLatRad DOUBLE, IN originLongRad DOUBLE, IN compLat DOUBLE, IN compLong DOUBLE, IN thisYear INT, IN thisCellTowerID BIGINT)
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.

	DECLARE compDistLat DOUBLE;
	DECLARE compDistLong DOUBLE;
	SET compDistLat = 6371.0 * 2.0 * { fn ATAN2(SQRT(POWER(SIN((compLat - originLatRad) / 2.0), 2.0)), SQRT(1 - POWER(SIN((compLat - originLatRad) / 2.0), 2.0))) };
	SET compDistLong = 6371.0 * 2.0 * { fn ATAN2(SQRT(COS(compLat) * COS(originLatRad) * POWER(SIN((compLong - originLongRad) / 2.0), 2.0)), SQRT(1 - COS(compLat) * COS(originLatRad) * POWER(SIN((compLong - originLongRad) / 2.0), 2.0)))};

  CREATE TEMPORARY TABLE LatLongConvertHelper1 AS (SELECT  ID, Latitude, Longitude, Latitude * PI() / 180 AS LatitudeRadians, - (Longitude * PI() / 180) AS LongitudeRadians, `Yr` FROM    calllocations WHERE   Yr = thisYear);
 
  
  CREATE TEMPORARY TABLE tbCalcLatLongDist AS (SELECT  ID, Latitude, Longitude, LatitudeRadians, LongitudeRadians, 6371.0 * 2.0 * { fn ATAN2(SQRT(POWER(SIN((LatitudeRadians - originLatRad) / 2.0), 2.0)), SQRT(1 - POWER(SIN((LatitudeRadians - originLatRad) / 2.0), 2.0))) } AS distLat, 
             6371.0 * 2.0 * { fn ATAN2(SQRT(COS(LatitudeRadians) * COS(originLatRad) * POWER(SIN((LongitudeRadians - originLongRad) / 2.0), 2.0)), SQRT(1 - COS(LatitudeRadians) * COS(originLatRad) * POWER(SIN((LongitudeRadians - originLongRad) / 2.0), 2.0)))
             } AS distLong FROM LatLongConvertHelper1);
             
  DROP TABLE LatLongConvertHelper1;

  -- This is an initial query that is simple which is intended to save processing time rather than using a function
	--  with the POWER() function on all the points
	-- No tests have been run to see if this saves time
	-- This likely saves no time at all gien that two Haversone computations were needed above to compute distance
	--  along latitudinal and longitudal directions
  CREATE TEMPORARY TABLE tbFindNearPoints AS (SELECT * FROM    tbCalcLatLongDist  WHERE   ABS(compDistLat-distLat)/1.609344 <= 1.5 AND ABS(compDistLong-distLong)/1.609344 <= 1.5);


	-- Free memory
	DROP TABLE tbCalcLatLongDist;
  
  INSERT INTO celltowercallcombos (CellTowerID, CallLocID, `Year`)  SELECT  thisCellTowerID, ID, thisYear FROM tbFindNearPoints  WHERE   sqrt(POWER(compDistLat-distLat,2.0) + POWER(compDistLong-distLong,2.0))/1.609344 <= 1.5;

	DROP TABLE tbFindNearPoints;
	
END ;;
DELIMITER ;
