CREATE DEFINER=`root`@`localhost` PROCEDURE `spOptResultsCallLocationToTableau`(IN thisYear INT)
BEGIN

	INSERT INTO tbtableaudata (LocType, Latitude, Longitude, Capacity, CellTowerID, CallCount, `Year`)

  SELECT 'CallLoc', calllocations.Latitude,

       calllocations.Longitude,

       1, tboptresults.CellTowerID, 1,

       tboptresults.Yr

  FROM networkopttest.tboptresults tboptresults

       INNER JOIN networkopttest.calllocations calllocations

          ON     (tboptresults.Yr = calllocations.Yr)

             AND (tboptresults.CallLocID = calllocations.ID)

  WHERE tboptresults.Yr = thisYear;

  

END ;;
