CREATE DEFINER=`root`@`localhost` PROCEDURE `spOptResultsCellTowerToTableau`(IN thisYear INT)
BEGIN

	INSERT INTO tbtableaudata (LocType, Latitude, Longitude, Capacity, CellTowerID, CallCount, `Year`)

  SELECT 'CellTower', celltowerlocations.Latitude,

       celltowerlocations.Longitude,

       tboptresultscelltowercapadd.CapacityCalls,

       celltowerlocations.ID,

       COUNT(tboptresults.CallLocID),

       tboptresults.Yr

  FROM (networkopttest.tboptresults tboptresults

        INNER JOIN networkopttest.celltowerlocations celltowerlocations

           ON (tboptresults.CellTowerID = celltowerlocations.ID))

       INNER JOIN

       networkopttest.tboptresultscelltowercapadd tboptresultscelltowercapadd

          ON (tboptresultscelltowercapadd.Yr = tboptresults.Yr)

GROUP BY celltowerlocations.Latitude,

         celltowerlocations.Longitude,

         tboptresultscelltowercapadd.CapacityCalls,

         celltowerlocations.ID,

         tboptresults.Yr

  HAVING tboptresults.Yr = thisYear

ORDER BY celltowerlocations.ID ASC;

END ;;
